import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  calling(method) {
    return "Hello " + method;
  }

  render() {
    const title = 'Calling Function';
    return (
      <div className="App">
        <h2>First Title: {this.calling('react')} {1+1}</h2>
      </div>
    );
  }
}

export default App;
